function trackVisitedPages(event, trackingHistory) {
  window.dataLayer.push(...event);
  return event
}

// Allow `trackVisitedPages` to listen only on `PAGE_VISITED` event
trackVisitedPages.eventType = 'PAGE_VISITED';

export default trackVisitedPages;
